import React from 'react';
import {IoLocationSharp} from 'react-icons/io5';

function TopBar() {

    return(
        <div style={{display: 'flex', height: 100, backgroundColor: "orange"}}>
            <IoLocationSharp style={{fontSize: 24, display: 'flex'}}/>
            <h1 style={{backgroundColor: '#fff', height: 30, padding: 10, borderRadius: 25}}>Helsinki</h1>
        </div>
    )
}

export default TopBar;
